      "description": "<p>The lunch break is almost there and all of the young penguins would finally get the fish they've been craving for. However, some rascals think they are quick enough to snatch some of the fish before the lunch break starts, but they have forgotten one thing - the Hall Monitor!<br /><br />Each school day one of the penguins is designated to watch over the school, and this is his moment to shine - for each rascal penguin he catches he would get additional fish! A fun run takes place - the rascals are running everywhere and trying to snatch some fish on their way, but the Hall Monitor is trying to catch each and one of them to have some order in the school. Who will be more successful?<br /><br /><strong> ICECOOL</strong> is a flicking game in which each round one of the players takes the role of the Hall Monitor (also called &quot;the Catcher&quot;) - his aim will be to catch each other penguin and get points for that. The others (also known as &quot;Runners&quot;) will try to run through several doors, thus gaining fish (that give them points) on their way. When either the Hall Monitor has caught each other penguin once or any of the others has gone through all 3 doors that have fish on them, the round is over. Each player will take the role of the Hall Monitor once and at the end of the game the winner will be the one with the most points on their fish cards.<br /><br />The penguins can be flicked in a straight line, make curves and even jump over the walls! Each player will have to use the best of their skills in order to get the most points in this fun and exciting game. It's not just cool, it's ICE COOL!</p>",
