      "description_preview": " Build your own track, choose your car, and pitch it! Choose the best trajectory using the safety rails, stay on your wheels and don't go off the track if you don't want a penalty! This game of skill is made of wood and is composed of 16 track parts, which allow you to build a vast number of 3.9 meter long tracks. \r\n In PitchCar, players pick a car, build a track and use the flick technique to propel their racing car to the finish line! take the best trajectories using the safety railings, remain on your wheels and don’t get out of the track or the penalty won’t be far! a beautiful creation, this dexterity game is made of wood and is composed of 16 portions of track, allowing you to make a multitude of different tracks! "
