      "description_preview": " There is always one, and only one, matching symbol between any 2 cards in this party game. Spot it and you win!  A sharp eye and a little bit of speed is all it takes to become a Spot it! master. \r\n  Spot it! 5th Anniversary  commemorates the fifth birthday of the original Spot it! game with a sparkly new tin and the addition of a cupcake symbol. All of the symbols were reshuffled to bring you a whole new game. Game mechanics remain unchanged. There is always one, and only one, matching symbol between any two cards. Spot it! first to win! For two to eight players. "
