      "description_preview": "The suspense is building — and so are you! Carefully pull a wood block out of the tower and place it on top. It’s easy at first, but as more blocks get pulled, the tower starts to get unsteady…and you’ll be on the edge of your seat just trying to keep it from falling! Stay cool, stay calm and stay steady, because the last player to complete their turn before someone makes it topple, wins!"
