      "description_preview": " Players of all ages can now venture across America by train in Alan R. Moon’s Ticket to Ride: First Journey. With a brand new map and simplfied rules, First Journey is the perfect way to introduce new players to the game of cross-country travel. Just like in Ticket to Ride, players collect train cards, claim routes, and try to connect cities coast-to-coast. In First Journey, though, routes are shorter, train cards are drawn straight from the deck, and the game ends when one player completes six tickets, claiming the Golden Ticket as their prize. Climb aboard, travelers, your incredible First Journey awaits! "
