      "description": "<p>The classic game of red versus black. On a square checkered board, where individual color squares alternate between the two colors, the two sides are divided with each player controlling half. Discs of each players' color are placed in the very back two rows of their side, with single spaces in between.</p>\r\n<p>The goal of the game is to move forward and hop over your opponent's pieces to eliminate them before they do the same. Pieces can only move on space towards their opponent's side and only to an adjacent, diagonal location. The only exception to this is when you attack, or &quot;jump&quot;, your opponent. This move has you moving two spaces toward your opponent's side in a diagonal direction where one of your opponent's discs is located in between. If you are successful, the jumped piece is removed from the board. You may not make a move if there is a piece blocking your end location (your's right next to you for regular moves, or two in a row in the case of an attack jump. You are only ever allowed to make legal moves that have a location to go to. Blocked pieces cannot move.</p>\r\n<p>In addition to moving the one direction toward your opponent's side, trying to attack (jump) your opponent's pieces. , there is an additional bonus move. If you are able to move one of your discs all the way to the far edge of your opponent's side, your piece is turned into a &quot;king&quot; with an additional checker disc added on top of it to signify this. The bonus of a king is they are able to move both forward AND BACKWARD as long as they adhere to all other movement rules.</p>\r\n<p>Once all of a player's checker discs (player pieces) are removed from the board because they have been jumped, that player loses and the other player is victorious.</p>",
