      "description_preview": " The bazaar is bustling: it's the big day of the rug market! Each player is a salesperson that tries to outwit the others. Each player has a turn to throw the dice and then move Assam, the market organizer. If Assam stops on an opponent's rug, the sales person must make a payment to its owner before putting one of his or her own rugs on the adjoining space. When the last rug has been laid, the total number of visible rugs and the number owned by each salesperson are added up: best player wins! Includes game board, 40 wood playing pieces, 6 sided die, 57 fabric tiles, fabric bag and instructions. For 2 to 4 Players. Ages 6 & Up. "
