      "description": "<p><strong>Sidereal Confluence: Trading and Negotiation in the Elysian Quadrant</strong> is a unique trading and negotiation game.</p>\r\n<p>Over the course of the game, each race must trade and negotiate with the rest to acquire the resources necessary to fund their economy and allow it to produce goods for the next turn. While technically a competitive game, Sidereal Confluence has a uniquely cooperative feel during the trading phase as no race has the ability to thrive on its own. Trade well, and you'll develop technologies and colonize planets to form a civilization that is the envy of the galaxy.<br /><br />Each player chooses one of the nine unique and asymmetrical alien races that have come together to form a trade federation in their quadrant. Each race has its own deck of cards representing all the existing and future technologies it might research. Some races also have other cards related to unique features of their culture. These cards represent portions of the culture's economy and require spending some number of resources to use, resulting in an output of more resources, ships, and possibly victory points. Since each culture's outputs rarely match their inputs, players need to trade goods with one another to run their converters to create the resources they truly need to run their society most efficiently and have an effective economy. Almost everything is negotiable, including colonies, ships, VP and all kinds of resources. <br /><br />Each game round contains an open trading phase in which all players can negotiate and execute deals for resources, ships, colonies, even the temporary use of technologies! Players with enough resources can also research technologies, upgrade colonies, and spend resources on their race's special cards during this phase. Once complete, all players simultaneously run their economies, spending resources to gain more resources. The Convocation follows, starting with players sharing newly researched technologies with all other races and following with bidding to acquire new colonies and research teams. Researching a new technology grants many victory points for the prestige of helping galactic society advance. When one race builds a new technology, it is shared with everyone else. Technologies can be upgraded when combined with other technologies.<br /><br />The ultimate goal is victory points, which are acquired by researching technologies, using your economy to convert resources to goods, and converting your leftover goods into points at the end of the game.<br /><br />The game is almost all simultaneous play, keeping the game play moving.</p>\r\n<p><strong>Contents:</strong></p>\r\n<ul>\r\n<li>390 Cards</li>\r\n<li>292 Wood pieces</li>\r\n<li>Dozens of tokens</li>\r\n<li>9 Player sheets detailing tips and advice on how to play a race</li>\r\n<li>Rulebook</li>\r\n</ul>",
