      "description_preview": "  Monikers  is a dumb party game that respects your intelligence. The rules are pretty simple: get your friends to guess the name on your card. Each team has 60 seconds to get through as many weird, inappropriate names as they can. In the first round, you can say anything you want. In the second, you can only use one word. And in the third, you can't say anything at all - just charades. The same cards are used in each round, so by the end of the game, you've made up a bunch of jokes together. "
