      "description": "<p>Night has fallen and your mind is floating in a magical world of dreams. But rest eludes you—the Dream Spirits want to have some fun tonight! Communicate with the Dream Spirits and try to interpret their messages in When I Dream, new from Repos! Become the dreamer, put on your sleep mask, and try to figure out your dream and which spirits are the Naughty ones. Become a Good Spirit and help the Dreamer by giving him clues about the dream before the Naughty Spirits mess it up. You can learn how to play in a few minutes and have a great laugh right from the start. Each role is both challenging and entertaining, giving the game more depth according to the player's imagination. When I Dream truly provides a wonderful experience with a unique dream every round.</p>\r\n<p>At the beginning of each round of <em><strong>When I Dream</strong></em> one player takes the role of the Dreamer and &quot;falls asleep&quot;, wearing a cloth mask. The other players are secretly dealt their role cards determining what kind of spirits they are &quot;good&quot; or &quot;naughty&quot; or if they are just &quot;tricksters&quot; changing sides as the game goes by.</p>\r\n<p>The whole round lasts 120 seconds in which the spirits are drawing &quot;Dream&quot; cards depicting a specific element of the dream, trying to describe them to the dreamer using one word each. The dreamer can guess what the element of the Dream is at any time, placing the card to the good spirits team side if the guess was correct and in the naughty spirits pile if it was not. <br />At the end of the round the Dreamer and the good spirits get a point for every card in the good spirits pile, when the naughty spirits get one point for every card in the naughty spirits pile. The tricksters get points according to how well balanced the two teams were at the end of the round, gaining extra points if they managed to equally balance the two piles.</p>\r\n<p>At the end of the round, the dreamer must use the words he guessed and story-tell his dream for extra points before he opens his eyes.</p>\r\n<p>You can learn how to play in a few minutes and have a great laugh right from the start. Each role is challenging and entertaining giving the game more depth according to the player’s imagination, providing a wonderful experience with a unique dream every round.</p>",
