      "description": "<p><em>*The Default edition may be any edition of this game. Designers, publishers and game box may vary.</em></p><table><tbody>\r\n<tr>\r\n<td>Designer(s)</td>\r\n<td>Ludovic Maublanc</td>\r\n</tr>\r\n<tr>\r\n<td>Publisher(s)</td>\r\n<td>\r\n<a href=\"https://boardgameco.myshopify.com/collections/asmodee\" target=\"_self\">Asmodee</a>, <a href=\"https://boardgameco.myshopify.com/collections/repos-production\" target=\"_self\">Repos Production</a>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>Players</td>\r\n<td>4-6, <a href=\"https://boardgameco.myshopify.com/collections/best-with-6\" target=\"_self\">Best With 6</a>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>Play Time</td>\r\n<td><a href=\"https://boardgameco.myshopify.com/collections/filler-under-30-minutes\" target=\"_self\">Filler - Under 30 Minutes</a></td>\r\n</tr>\r\n<tr>\r\n<td>Suggested Age</td>\r\n<td><a href=\"https://boardgameco.myshopify.com/collections/recommended-age-10\" target=\"_self\">10+</a></td>\r\n</tr>\r\n</tbody></table><p>In an abandoned warehouse, a band of gangsters is splitting their latest haul, but they can't come to an agreement on the split. It's time to let the guns do the talking, and soon everyone is aiming at everyone... All you have to do is stay alive and have the most money at the end of the game!</p><p>CA$H'n GUN$ will make you relive the best scenes from gangster movies and other modern detective stories, where the flimsiest excuse serves to let bullets fly!</p><p>Fun, bluff and negotiations are to be had. Thing is, do you have enough guts to play?</p><p>This is a game where laughter isn't the only deadly thing...</p>",
