      "description_preview": "  *The Default edition may be any edition of this game. Designers, publishers and game box may vary.    \r\n \r\n Designer(s) \r\n Ludovic Maublanc \r\n \r\n \r\n Publisher(s) \r\n \r\n Asmodee ,  Repos Production \r\n \r\n \r\n \r\n Players \r\n 4-6,  Best With 6 \r\n \r\n \r\n \r\n Play Time \r\n  Filler - Under 30 Minutes  \r\n \r\n \r\n Suggested Age \r\n  10+  \r\n \r\n   In an abandoned warehouse, a band of gangsters is splitting their latest haul, but they can't come to an agreement on the split. It's time to let the guns do the talking, and soon everyone is aiming at everyone... All you have to do is stay alive and have the most money at the end of the game!  CA$H'n GUN$ will make you relive the best scenes from gangster movies and other modern detective stories, where the flimsiest excuse serves to let bullets fly!  Fun, bluff and negotiations are to be had. Thing is, do you have enough guts to play?  This is a game where laughter isn't the only deadly thing... "
