      "description": "<p>Life isn't fair... and neither is The Great Dalmuti! One round you're at the top of the heap, and the next you're peasant scum in this fast-paced card game of medieval one-upmanship. The players take their places in the pecking order, from Greater Peon to Greater Dalmuti, and try to get rid of the cards in their hands. Next round, everyone's roles could change because the faster you get rid of your cards, the higher you'll go. If you're unseated, you're really unseated: everyone moves around the table each round to take up their new positions. But don't get comfortable in the cushy chair of the Greater Dalmuti, because in a single hand even the lowliest Peon can boot you out the door. Sound unfair? Sure it is! But ah, the sweet taste of victory could make it all worthwhile....</p>",
