      "description": "<div>Draw what you see then guess what you saw for hilarious and unpredictable outcomes. It’s miscommunication at its best!</div>\r\n<div>\r\n<div>\r\n<div>\r\n<div>Telestrations is the visual version of the classic “telephone game” where you draw what you see, then guess what you saw to reveal hilarious outcomes!</div>\r\n</div>\r\n</div>\r\n<div>Here's How To Play &amp; LOL</div>\r\n<div>\r\n<p>Each player starts with their own erasable sketch book, marker and word card. A roll of the die determines each player’s secret word. The timer gets turned and everyone draws their word. After 60 seconds, everyone passes their book to the player on their left. Then each player takes a few seconds to guess in words(s) what they see, and passes again. The timer is turned and everyone draws the guess.This continues until everyone’s sketch book passes by every player and returns back to its original owner, where it’s time for The Big Reveal. Everyone shares their book and the hilarious miscommunication is revealed. Just like the game of “telephone,” the outcomes are unpredictable and the laughter is contagious!</p>\r\n</div>\r\n<div>Awards:</div>\r\n</div>\r\n<div>\r\n<div>\r\n<ul>\r\n<li>Board Game Geek: Golden Geek Winner </li>\r\n<li>Creative Child Magazine Awards</li>\r\n<li>Dr. Toy: 10 Best Games Winner</li>\r\n<li>Dr. Toy: 100 Best Children’s Products Winner</li>\r\n<li>Games Magazine 100 Games</li>\r\n<li>National Association For Gifted Children – Toy List</li>\r\n<li>The National Parenting Center Seal of Approval</li>\r\n<li>The Toy Insider Holiday List</li>\r\n<li>National Parenting Publications Awards: NAPPA Gold</li>\r\n<li>Origins Awards Nominee</li>\r\n<li>Parent’s Choice: Fun Stuff</li>\r\n<li>Tillywig Toy &amp; Media Awards – Laugh Out Loud Award</li>\r\n</ul>\r\n</div>\r\n</div>",
