      "description": "<p><b>Space Cadets: Dice Duel</b> - the &quot;Team vs. Team, Real-time, Dice-Rolling Game of Starship Combat!&quot; - pits two spaceships against one another in quick-paced combat. The players are divided into two teams, each team playing the crew of a ship and winning or losing together based on how well they perform. The game ends when one side destroys their opponent by causing four points of damage through torpedoes or mines. </p><p>Each ship has six Bridge Stations: </p><p>-- Engineering generates power for the other stations.</p><p>-- Helm maneuvers the ship on the map.</p><p>-- Weapons loads the torpedo tubes to attack the enemy.</p><p>-- Sensors locks onto the enemy so torpedoes can hit and uses jammers to stop the enemy from locking on.</p><p>--Shields helps protect the ship from enemy torpedoes.</p><p>-- Tractor Beams can grab the powerful crystals, move the enemy ship on the map and launch Mines. </p><p>Each player is in charge of one or more of these stations, or has the overall role of Captain to coordinate everything. There are no game turns in Space Cadets: Dice Duel; instead the game continues with players acting as quickly as possible until one side wins.</p>",
