      "description_preview": " Your home, the great city of Atlantis, is sinking. You must work together to construct a cosmic gate and save your people. \r\n Atlantis Rising is a cooperative worker placement game. Players will deploy citizens across the island of Atlantis and gather resources by rolling dice. Resources are easier to collect near the shore, but workers are more likely to be swallowed up by floodwaters. Work together and take strategic risks to save the people of Atlantis from destruction. "
