      "description": "<p>Our planet has run out of resources, and we are forced to move. We have discovered a series of planets and sent our rovers to test their environment with the hope of colonization. Several space rovers from the nSeed poject has confirmed viable colonization options. A competitive game for 1-6 players where players build the best colony to win!</p>\r\n<p>Each player has a goal of developing a Planet Unknown. Each round, each player will be place one development tile on their planet, which is a polyomino shape. Each development tile has two of six types of infrastructure on it which represent the infrastructure needed to support life on the planet. Placement of polyomino development tiles is important as a players wants to efficiently use the space of their planet and also create infrastructure synergy. After placing a development tile, players do two actions associated with their infrastructure type . Some development tile placements will trigger \"asteroids\" that make all planets harder to develop.</p>\r\n<p>The game innovates on the popular polyomino trend by allowing simultaneous yet strategic turn-based play.</p>",
