      "description_preview": " Become an unlikely survivor, locked in an underground base with something terrifying. Turn up your paranoia, as you try to guess what other players are up to, or what the contingency plan is. Work to learn the weaknesses of your nemesis – or run like hell. Switch off the lights in someone’s lab section. Take a dangerous trek to the outside bunker. And whatever you do, be ready for unexpected! \r\n The game comes with all the components needed for a cinematic Sci-Fi horror experience and doesn't require the Nemesis Core Box. \r\n Nemesis: Lockdown offers 1-5 player semi or full co-op experience that takes around  90-120 minutes and will be different every run! This stand-alone expansion also works with majority of the previous Nemesis content: other Alien races and most of the characters.  \r\n  - From Publisher  "
