      "description": "<p><strong>The Lantern May Fade, but the Coin Still Shines</strong><br /><br />The dark season has arrived. Money is tight, but opportunity is around every corner. And while the road is costly, the rewards are great! For these adventurous merchants, fame and fortune don't wait for the coming dawn.<br /><br />Become a Merchant of Highreach! Strategize and plan as you traffic the goods the kingdom needs to endure the dark season. Sell to heroes at the Ringway inn and make your fortune. Then deliver them to their faraway homes, along with a commission or two, and they'll be singing your name in the streets. Because when the darkness lifts, you'll need to balance fame and fortune if you want to be named the greatest merchant of all.<br /><br /><strong>1.</strong> Use your dice to select actions in the city<br /><br /><strong>2.</strong> Manage the resources in your wagon<br /><br /><strong>3.</strong> Interact with players and events on the Dark Road<br /><br /><strong>Contents:</strong></p>\r\n<div>1 Kingdom Board<br />1 Market Wheel<br />5 Building Tiles<br />2 District Markers<br />16 Lantern Tokens<br />24 Quartz Tokens<br />12 Horseshoe Tokens<br />60 Coin Tokens<br />4 Wagon Boards<br />4 Player Screens<br />4 Prestige Markers<br />4 Wagon Pawns<br />48 Hero Cards (44x67mm)<br />22 Companion Cards (59x92mm)<br />26 Event Cards (87x112mm)<br />7 Steed Cards (59x92mm)<br />19 Deed Cards (67x44mm)<br />30 Commission Tiles<br />6 Wagon Upgrade Tiles<br />84 Goods Tiles<br />28 Night Dice<br />8 Illuminated Dice<br />5 Market Dice<br />5 Travel Dice<br />1 Oracle Die<br />1 Ruins Die<br />1 Private Concern Wagon Pawn<br />1 Private Concern Prestige Marker<br />1 Private Concern Goods Marker<br />10 Private Concern Action Cards (59x92mm)<br />6 Guild Notice Cards (59x92mm)<br />3 Sarcophagus Cards (44x67mm)<br />6 Delivery Tiles<br />1 Rulebook<br />1 Solo Rulebook/Adventure Book</div>",
