      "min_playtime": 90,
      "max_playtime": 120,
      "min_age": 14,
      "description": "<p>Revive civilization, 5000 years after everything was destroyed. Lead your tribe and explore the frozen earth. Harness its resources. Recruit surface survivors to your cause. Build factories with powerful machines. And populate ancient sites to relearn your tribe's forgotten technologies.<br />--<br /><em><strong>Revive</strong></em> is a game for 1-4 players with asymmetric player powers, highly variable setup, and no fighting or direct conflict. Playing through the 5-part campaign unlocks additional contents, and once all contents have been unlocked, the game can be replayed indefinitely.<br />--<br />At the beginning of the game, each player gets a set of citizen cards, a tribe board, as well as a huge dual-layer player board. The tribe board shows your unique tribe ability and the ancient technologies that you may relearn during the game. The dual-layer player board is where you place your custom machines and upgrade your card slots.</p>\r\n<p>A main goal of the game is to reach and populate the large ancient sites. These ancient locations are randomized, and as they are important sources of victory points, they will shape your strategy differently each game.</p>\r\n<p>On your turn you take two actions:</p>\r\n<ul>\r\n<li>Play a card (its effect is determined by which card slot you use)</li>\r\n<li>Explore (reveal an area tile and recruit a new citizen card)</li>\r\n<li>Populate (populate an ancient location to learn a new technology)</li>\r\n<li>Build factory (the adjacent terrains determine which machine tracks you advance)</li>\r\n</ul>\r\n<p>In addition you may use power to activate any number of your machines, modifying your actions.</p>\r\n<p>Instead of taking two actions you may Hibernate. This will circulate your cards, moving your played cards to your resting area, and releasing the cards in your resting area back to you. In addition you regain your used power, so that you may activate your machines again.</p>\r\n<p>The multi-use cards play an important role: Each card shows a resource ability (on the top) and a special ability (on the lower part). Playing a card in one of your top slots activates the resource action; In a lower slot you activate the special ability. You may install slot modules in the card slots, and these are activated whenever you play a card matching its color. It is possible to find combinations that lets you chain cards, triggering several slot modules and abilities in one action.</p>\r\n<p>Building factories harness the power of the surrounding terrains, advancing your marker on one of three machine tracks. This may unlock machines that can be activated, using energy.</p>\r\n<p>Reaching certain milestones lets you take an artifact from the main board. Each artifact boosts one of the three scoring categories on your personal scoring card.</p>\r\n<p>The game ends when all artifacts have been taken, and the player with the most points wins.</p>",
