      "description": "<p><em>Far to the south of The Last Ruin lies a cliffside village called The Monument. For generations, it protected an ancient shrine until the day a crystal meteorite descended. The meteor's denizens slowly crept out into the world—bizarre monstrosities from nightmare, attacking all in their path. As they spread across the land, there was no intelligent malice nor grand invasion strategy; the creatures acted like a fungus—spreading into new territory sporadically.</em></p>\r\n<p><em>After many fruitless attempts to expel the monsters, the people of The Monument fled as their village crumbled, exiled to distant lands, resigned to a nomadic existence.</em></p>\r\n<p><em>Forty years later, there are rumors that the bizarre monsters are growing weak. They’re slower, less impervious to attack, some undergoing a gradual petrification until they crumble to dust. Is it the atmosphere? Are they dying of old age? Do they suffer from a strange disease? No one is certain, but as the news spreads, various factions set their eyes on the vacant, ruined village of The Monument. The original villagers, now refugees, are desperate to return and rebuild. But they must do it quickly, before someone else claims their home. This is their chance. It’s now or never.</em></p>\r\n<p>In <strong>Now or Never</strong>, you and up to three friends compete to best rebuild your ancestral village and guide the rest of the villagers on their journey home. Although the creatures of the meteorite have lost much of their strength, many of them remain, and you must fight them off to protect traveling villagers. <em>Now or Never</em> is the third game in the Arzium storybook series that includes <em>Above and Below</em> and <em>Near and Far</em>.</p>\r\n<p><em>Now or Never</em> is a competitive strategy game that allows you to:</p>\r\n<ul>\r\n<li>Choose one of four asymmetrical characters to play.</li>\r\n<li>Rebuild the village so that returning villagers have a place to live. You must carefully choose what and where to build to maintain an advantage, earning the biggest rewards for long-term planning.</li>\r\n<li>Interact with other players by hiring their specialists to perform special actions.</li>\r\n<li>Combat dangerous creatures to rescue villagers.</li>\r\n<li>Explore a fantasy landscape filled with bizarre places, technology, and peoples.</li>\r\n</ul>\r\n<p><em>Now or Never</em> includes two modes of play: standard and story. When playing in story mode, you read from a storybook when you explore, making choices and learning more about the characters and the world. Each character has their own set of stories, unique to the locations they explore and diverse in plot, perspective, and motive, allowing you to choose what direction your own story will take.</p>\r\n<p>Journey to The Monument and help rebuild your ancient home!</p>",
