      "description": "<p><em><strong>Mosaic: A Story of Civilization</strong></em> is a Civilization-Building game from Glenn Drover, designer of, among others, <em><a href=\"https://boardgamegeek.com/boardgame/22545/age-empires-iii-age-discovery\">Age of Empires III: The Age of Discovery</a></em>, <em><a href=\"https://boardgamegeek.com/boardgame/17133/railways-world\">Railways of the World</a></em>, <em><a href=\"https://boardgamegeek.com/boardgame/3633/sid-meiers-civilization-boardgame\">Sid Meier's Civilization: The Boardgame</a></em>, and <em><a href=\"https://boardgamegeek.com/boardgame/254386/raccoon-tycoon\">Raccoon Tycoon</a></em>.</p>\r\n<p><em>Mosaic</em> is an action selection game. On your turn, you will perform one of seven actions and acquire components.</p>\r\n<p>Acquiring Components is important in creating the unique mosaic of your civilization. They are used as prerequisites for many new technologies, as well as for scoring. Also, by pursuing specialization in one or more Civilization Components, you may be able to claim a ‘Golden Age’ of that type.</p>\r\n<p>As the game goes on and your Civilization grows, scoring cards are eventually revealed from the four decks. Each time a scoring card is revealed, your Civilization will score for each region that you dominate with your cities and military units. After the third scoring card is revealed, there is one final turn and the game ends. You will then score for your cities and towns, your wonders, projects, and golden ages, and for all of your cards that score for your unique Civilization Components.</p>\r\n<p>Please note that the solo rules are only included in the Kickstarter edition, not in the retail version.</p>",
