      "description": "<h3><strong>Explore the haunted Catacombs in a stand-alone <em>CLANK!</em> deck-building adventure like you’ve never seen it before!</strong></h3>\r\n<p>From series creator Paul Dennen and the team behind the <a href=\"https://direwolfdigital.com/news/dune-imperium-wins-tabletop-game-of-the-year-at-2022-sxsw-gaming-awards/\">award-winning <em>Dune: Imperium,</em></a> <strong><em>CLANK! Catacombs </em></strong>brings a new twist to the hit line of <em>CLANK!</em> deck-building board games: rather than a single dungeon to plunder, the map in <em>Catacombs</em> is built as you play with a series of modular tiles that are revealed as you find your way through tangled passages in search of treasure.</p>\r\n<p>Who knows what awaits in the depths below? Each play session presents a unique board that grows and changes as you explore, and fun new mechanics like Ghosts, Portals, and Wayshrines are sure to challenge even the most cunning thieves!</p>\r\n<p><strong>Leave the board behind with CLANK! Catacombs, a stand-alone deck-building adventure!</strong></p>\r\n<p><strong>The catacombs of the skeletal dragon Umbrok Vessna are mysterious and dangerous. Portals transport you all around the dungeon depths. Wayshrines offer vast riches to intrepid explorers. Prisoners are counting on you to free them. Ghosts, once disturbed, may haunt you to death.</strong></p>\r\n<p><strong>Each trip into the catacombs is unique, as you lay tiles to create the dungeon. You can play using only the all-new Dungeon Deck, or include cards from previous CLANK! expansions.</strong></p>\r\n<p><strong>Find your fortune (and escape the dragon!) in CLANK! Catacombs.</strong></p>\r\n<p>Everything you need to play <em>Catacombs</em> comes inside the box, making it the perfect entry point for new players looking to test their burglarish wiles. But for seasoned <em>CLANK!</em> fans, <em>Catacombs</em> is compatible with existing expansions for the original game, and brings a whole new way to enjoy your favorite deck-builder.</p>\r\n<p><em>CLANK! Catacombs</em> will be available for pre-order from Dire Wolf and Friendly Local Game Stores later this year. Stay tuned for more information on our upcoming retailer program, and if you’re headed to Gen Con be sure to stop by for your first chance to play <em>CLANK! Catacombs!</em></p>",
