      "description": "<p><em><strong>Wingspan</strong></em> is a competitive, medium-weight, card-driven, engine-building board game from Stonemaier Games.</p>\r\n<p>You are bird enthusiasts—researchers, bird watchers, ornithologists, and collectors—seeking to discover and attract the best birds to your aviary. Each bird extends a chain of powerful combinations in one of your habitats (actions). These habitats focus on several key aspects of growth:</p>\r\n<ul>\r\n<li>Gain food tokens via custom dice in a birdfeeder dice tower</li>\r\n<li>Lay eggs using egg miniatures in a variety of colors</li>\r\n<li>Draw from hundreds of unique bird cards and play them</li>\r\n</ul>\r\n<p>The winner is the player with the most points after 4 rounds.</p>",
      "commentary": "<p>Wingspan's artists, Ana and Natalia, have been friends since high school in Colombia. After Natalia moved to the U.S., she ran into <a href=\"/designer/MANNUPclkd/alan-stone\" target=\"_blank\">Alan Stone</a> through their kids' school, which led to her getting connected with <a href=\"/designer/QIz5pAPzFk/jamey-stegmaier\" target=\"_blank\">Jamey Stegmaier</a> of <a href=\"/publisher/njVFVNfJc7/stonemaier-games\" target=\"_blank\">Stonemaier Games</a>. Check out this interview <a href=\"/forum/XTO9WbDBqe/how-the-best-board-game-of-2019-wingspan-reunited-two-high-school-friends-interview\" target=\"_blank\">here</a></p>\r\n<p>In an interview, designer <a href=\"/designer/UBhK4cSEV6/elizabeth-hargrave\" target=\"_blank\">Elizabeth Hargrave</a> commented that she felt &quot;... there were too many games about castles and space, and not enough games about things I'm interested in. So I decided to make a game about something I cared about.&quot;</p>",
      "faq": "<p><strong>Is it hard to learn?</strong></p>\r\n<p>The rulebook is well-organized and easy to follow. You can learn how to play the game after reading through 10 pages of rules accompanied by plenty of visual cues and breathing space between text. Alternatively, you can use the Quick-Reference Guide (page 2 of the Appendix) if you want to learn the game in real-time.</p>\r\n<p>Veteran gamers will find it relatively easy to learn and teach, while new gamers may feel that it's more complex than what they're used to. When it comes to learning the actual strategy, the game will likely \"click\" for the majority of the players by the time your group finishes the 1st Round (there are 4 Rounds total).</p>\r\n<p>Due to the game's simple turn structure and types of actions available, you'll quickly pick up on how the game works by watching your friends play. So while you may not be playing optimally or finding the best combos to pull off, you'll likely feel comfortable by the start of Round 2.&nbsp;</p>\r\n<p>For those who've played Stonemaier Games' <a class=\"game-preview\" href=\"/game/7NYbgH2Z2I/viticulture-essential-edition\" data-tipped-options=\"ajax: {data: { ids: '7NYbgH2Z2I', client_id: 'W0AQGbjlZE' }}\">Viticulture: Essential Edition</a>, Wingspan is less complex than Viticulture in terms of strategy elements and has fewer rules to memorize. If you have detailed questions about the game, you'll likely find an answer within this <a href=\"https://stonemaiergames.com/games/wingspan/rules/\">comprehensive FAQ</a> put together by Stonemaier Games.</p>\r\n<p><strong>Is it good for 2 players?</strong></p>\r\n<p>2-player gameplay won't trigger pink bird powers as frequently, which are activated once per turn if a criteria is met during an opponent's turn (e.g. get \"X\" benefit when another player does \"Y\" action). There will also be less competition for valuable birds cards or for the food dice from the birdfeeder.</p>\r\n<p>Wingspan is a relatively low interaction game. This means that the gameplay won't feel much different at low or high player counts and makes for an easily scalable game. So if you love Wingspan at high player counts, you'll love it at 2-player count as well. On the other hand, if you're someone who prefers highly interactive games where your actions directly impact another player's strategies, you should try it out before making the purchase.</p>\r\n<p><strong>Is there a hand limit?</strong></p>\r\n<p>There is no limit to the number of bird cards you can have in your hand.</p>\r\n<p><strong>Can you play alone?</strong></p>\r\n<p>As with most Stonemaier Games titles, Wingspan comes with a separate set of rules for the Automa, an AI opponent that simulates playing against a human opponent. This game was rated #13 on \"2020 People's Choice Top 200 Solo Games.\"</p>\r\n<p><strong>Who goes first?</strong></p>\r\n<p>The first player is randomnly selected by your group. That player gets the first-player token and will kick off the game.</p>\r\n<p><strong>How do you win?</strong></p>\r\n<p>The player with the most points wins. Tally up points for the following and determine the winner:</p>\r\n<ul>\r\n<li>Points based on bird cards played on your tableau</li>\r\n<li>Points for bonus card(s) accomplished</li>\r\n<li>Points for end-of-round goals</li>\r\n<li>1 point for each:\r\n<ul>\r\n<li>Egg on a bird card</li>\r\n<li>Food token cached on a bird card</li>\r\n<li>Card tucked under a bird card</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p>In case of a tie, number of unused food tokens serve as tiebreaker. If still tied, they share the victory.</p>\r\n<p><strong>What's inside the box?</strong></p>\r\n<ul>\r\n<li>170 unique bird cards (57x87mm)</li>\r\n<li>26 bonus cards (57x87mm)</li>\r\n<li>16 Automa cards (57x87mm)</li>\r\n<li>103 food tokens</li>\r\n<li>75 egg miniatures</li>\r\n<li>5 custom wooden dice</li>\r\n<li>5 player mats</li>\r\n<li>1 birdfeeder dice tower</li>\r\n<li>2-piece Game Trayz custom tray</li>\r\n<li>1 goal mat</li>\r\n<li>8 goal tiles</li>\r\n<li>1 first-player token</li>\r\n<li>40 action cubes (8 per player)</li>\r\n<li>1 scorepad (50 sheets; 1 sheet used for all players each game)</li>\r\n<li>3 rulebooks</li>\r\n</ul>",
