      "description": "<p>The two rival spymasters know the secret identities of 25 agents. Their teammates know the agents only by their CODENAMES.<br /><br />The teams compete to see who can make contact with all of their agents first. Spymasters give one-word clues that can point to multiple words on the board. Their teammates try to guess words of the right color while avoiding those that belong to the opposing team. And everyone wants to avoid the assassin.<br /><br />Codenames: win or lose, it's fun to figure out the clues.</p>",
      "commentary": "",
      "faq": "<p><strong>How do you eplain this game?</strong></p>\n<p>This is a word-guessing game where two opposing teams compete to get in contact with all of their secret agents first by discovering their codenames. Each team has an assigned Spymaster who possesses a key card that reveals the location of all of the team's agents, and they must give a one word clue to help the team discover their agents. Take a risk by offering a clue that will point to as many of the secret agents, but you may unintentionally alert the assassin instead. (Here are the <a href=\"https://czechgames.com/files/rules/codenames-rules-en.pdf\">official rules in PDF</a>.)</p>\n<p><strong>What is the best version to buy?</strong></p>\n<p>The soaring popularity of Codenames spawned more than 11 different versions to choose from including Marvel, Harry Potter, Disney, and more. If you're looking for the best version that will strike a chord with the most diverse set of crowds, start with the original Codenames. If you're looking for a solid 2-player cooperative experience, get <a class=\"game-preview\" href=\"/game/9e0nNBNyOU/codenames-duet\" data-tipped-options=\"ajax: {data: { ids: '9e0nNBNyOU', client_id: 'W0AQGbjlZE' }}\">Codenames: Duet</a>.</p>\n<p><strong>How can I play online with my friends?</strong></p>\n<p><a href=\"https://codenames.game/\">Codenames Online</a> is the official free-to-play digital adaptation of the board game. Create a room, send the invite link, and catch up with friends and families by playing a fun board game alongside your usual Zoom meetings.</p>\n<p><strong>Can you play with 2 players?</strong></p>\n<p>The official rules include a 2-player variant to allow cooperative play against a simulated opponent. You can try this out even with a large group if they're not in the mood for competitive play. If you're looking for a strictly 2-player game, then I'd recommend <a class=\"game-preview\" href=\"/game/9e0nNBNyOU/codenames-duet\" data-tipped-options=\"ajax: {data: { ids: '9e0nNBNyOU', client_id: 'W0AQGbjlZE' }}\">Codenames: Duet</a>, which was specifically designed for a low player count.</p>\n<p><strong>How many guesses do you get every turn?</strong></p>\n<p>In every turn, the spymaster will say a one-word clue and a number, which tells the team how many codenames are associated with the clue. The team is allowed as many guesses as that number plus one extra. Taking this risk is a big part of the fun!</p>",
