      "description_preview": " From Everfrost to Bellsong, many a peaceful year have passed in Everdell — but the time has come for new territories to be settled and new cities to be established. You will be the leader of a group of critters intent on just such a task. There are buildings to construct, lively characters to meet, events to host— you will have a busy year ahead of you! Will the sun shine brightest on your city before the winter moon rises? \r\n \r\n \r\n 128 Critter and Construction cards (48 unique cards) \r\n \r\n \r\n 16 Event Mini-cards \r\n \r\n \r\n 11 Forest Mini-cards \r\n \r\n \r\n 30 Berries \r\n \r\n \r\n 30 Twigs \r\n \r\n \r\n 25 Resin \r\n \r\n \r\n 20 Pebbles \r\n \r\n \r\n 30 Point tokens \r\n \r\n \r\n 20 Occupied tokens \r\n \r\n \r\n 24 Wooden workers \r\n \r\n \r\n 1 8-sided die \r\n \r\n \r\n 1 Game Board, Ever Tree, and Starter Event tiles \r\n \r\n "
