      "description_preview": "  Ticket to Ride  is a cross-country train adventure game. Players collect train cards that enable them to claim railway routes connecting cities throughout North America. The longer the routes, the more points they earn. Additional points come to those who can fulfill their Destination Tickets by connecting two distant cities, and to the player who builds the longest continuous railway. So climb aboard for some railroading fun and adventure. You've got a Ticket to Ride!  October 2, 1900 -- it's 28 years to the day that noted London eccentric, Phileas Fogg accepted and then won a 20,000 bet that he could travel Around the World in 80 Days. Now at the dawn of the century some old friends have gathered to celebrate Fogg's impetuous and lucrative gamble -- and to propose a new wager of their own. The stakes: $1 million in a winner-takes-all competition. The objective: to see the most cities in North America -- in just 7 days.   -Spiel Des Jahres 2004(German game of the year) -As d'Or Cannes 2004 (French game of the year) -Game of the year 2004 - Japan -Game of the year 2004 - Sweden -Game of the year 2004 - Finland -Diana Jones Excellence in Gaming Award 2004 -Origins Award Winner - Best Board Game 2005 -Game of the year 2004 - Spain -Parent's Choice Foundation Silver Medal 2004 "
