      "description": "<p><em><strong>Brass: Birmingham</strong></em> is an economic strategy game sequel to Martin Wallace's 2007 masterpiece, <em>Brass</em>. <em>Birmingham</em> tells the story of competing entrepreneurs in Birmingham during the industrial revolution, between the years of 1770-1870.</p>\r\n<p>As in its predecessor, you must develop, build, and establish your industries and network, in an effort to exploit low or high market demands.</p>\r\n<p>Each round, players take turns according to the turn order track, receiving two actions to perform any of the following actions (found in the original game):</p>\r\n<p>1) <strong>Build</strong> - Pay required resources and place an industry tile.<br />2) <strong>Network</strong> - Add a rail/canal link, expanding your network.<br />3) <strong>Develop</strong> - Increase the VP value of an industry.<br />4) <strong>Sell</strong> - Sell your cotton, manufactured goods and pottery.<br />5) <strong>Loan</strong> - Take a £30 loan and reduce your income.</p>\r\n<p><em>Brass: Birmingham</em> also features a new sixth action:</p>\r\n<p>6) <strong>Scout</strong> - Discard three cards and take a wild location and wild industry card. (This action replaces Double Action Build in original <em>Brass</em>.)</p>\r\n<p>The game is played over two halves: the canal era (years 1770-1830) and the rail era (years 1830-1870). To win the game, score the most VPs. VPs are counted at the end of each half for the canals, rails and established (flipped) industry tiles.</p>\r\n<p><em>Birmingham</em> features dynamic scoring canals/rails. Instead of each flipped industry tile giving a static 1 VP to all connected canals and rails, many industries give 0 or even 2 VPs. This provides players with the opportunity to score much higher value canals in the first era, and creates interesting strategy with industry placement.</p>\r\n<p>Iron, coal, and cotton are three industries which appear in both the original <em>Brass</em> as well as in <em>Brass: Birmingham</em>.</p>\r\n<p><strong>New &quot;Sell&quot; system</strong></p>\r\n<p>Brewing has become a fundamental part of the culture in Birmingham. You must now sell your product through traders located around the edges of the board. Each of these traders is looking for a specific type of good each game. To sell cotton, pottery, or manufactured goods to these traders, you must also &quot;grease the wheels of industry&quot; by consuming beer. For example, a level 1 cotton mill requires one beer to flip. As an incentive to sell early, the first player to sell to a trader receives free beer.</p>\r\n<p><em>Birmingham</em> features three all-new industry types:</p>\r\n<p><strong>Brewery</strong> - Produces precious beer barrels required to sell goods.</p>\r\n<p><strong>Manufactured goods</strong> - Function like cotton, but features eight levels. Each level of manufactured goods provides unique rewards, rather than just escalating in VPs, making it a more versatile (yet potentially more difficult) path vs cotton.</p>\r\n<p><strong>Pottery</strong> - These behemoths of Birmingham offer huge VPs, but at a huge cost and need to plan.</p>\r\n<p><strong>Increased Coal and Iron Market size</strong> - The price of coal and iron can now go up to £8 per cube, and it's not uncommon.</p>\r\n<p><em>Brass: Birmingham</em> is a sequel to Brass. It offers a very different story arc and experience from its predecessor.</p>",
      "commentary": "<p>Cover and card art by Mr. Cuddington, the same husband-and-wife creative duo behind <a href=\"/game/VibNUMwsqr/santorini\" target=\"_blank\">Santorini</a>. The shift from cutesy Greek Gods and Goddesses to somber, cold industrial era showcases their stylistic breadth.</p>",
