      "description": "<p>Welcome to Quedlinburg, where the best quack doctors gather to brew potions to cure smelly feet, homesickness, and hiccups. You're one of them. Your challenge is to make a special brew that will make you the best miracle doctor in the land.</p>\r\n<p><em>The Quacks of Quedlinburg</em> is a fun, quick push-your-luck game where you draw from your stock of ingredients, adding them to your cauldron, until your brew seems just right. But be careful: add the wrong ingredient and the potion could spoil. Do you stop early to raise your chance of making a better potion later, or risk a setback to reach for more money and fame now? Finding the right balance between risk and reward is key.</p>\r\n<p><strong>Winner of the 2018 Gamer</strong><strong>'s Game of the Year in Germany </strong><strong>(the Kennerspiel des Jahres - considered the Oscar of boardgames)</strong></p>",
