      "description": "<div>\r\n<p>Welcome to the world of <em><strong>Santorini</strong></em>, a fantastic reimagining of the classic abstract game from 2004. Players are given a sandbox in which to play as gods, moving their workers around the board to build up a beautiful, multi-tiered city. Do you have what it takes to outsmart your opponents? Find out, in <em>Santorini</em>!</p>\r\n<div>\r\n<div>\r\n<p><em><strong>Santorini</strong></em> is a re-imagining of the purely abstract 2004 edition. Since its original inception over 30 years ago, Santorini has been continually developed, enhanced and refined by designer Gordon Hamilton.</p>\r\n<p>Santorini is an accessible strategy game, simple enough for an elementary school classroom while aiming to provide gameplay depth and content for hardcore gamers to explore, The rules are simple. Each turn consists of 2 steps:</p>\r\n<p><strong>1. Move</strong> - move one of your builders into a neighboring space. You may move your Builder Pawn on the same level, step-up one level, or step down any number of levels.</p>\r\n<p><strong>2. Build</strong> - Then construct a building level adjacent to the builder you moved. When building on top of the third level, place a dome instead, removing that space from play.</p>\r\n<p><strong>Winning the game</strong> - If either of your builders reaches the third level, you win.</p>\r\n<p><strong>Variable player powers</strong> - Santorini features variable player powers layered over an otherwise abstract game, with 40 thematic god and hero powers that fundamentally change the way the game is played.</p>\r\n</div>\r\n</div>\r\n<p><br /><br />Turns in <em>Santorini</em> are made up of two simple step: Move and Build. Move around the board and build a building in a spot adjacent to one of your workers. The first player to move their worker from a second level building to a third level building wins the game! Though, there are a few things that add a wrinkle to the basic formula.<br /><br />Invoke the Power of the gods!<br />Each player will have access to a god power which lets them do things a little differently than normal. Be it changing the rules for how you can build or move, changing how you interact with other players, or providing you with an alternate victory condition, the 30 different god powers are sure to make every game of <em>Santorini</em> different and exciting!</p>\r\n</div>",
